function getMobileToken(comm=true) {
    let JsonRet = $.ajax({
        url: "getMobileToken",
        method: "POST",
        data: {
            token: getCookieToken(),
            what: "getMobileToken"
        },
        async: false,
        success: function(){
            if(comm)
                messageSee("Pomyślnie wykonano żądanie", "success")
        },
        error: function(){
            if(comm)
                messageSee("Błącz łączenia z serwerem", "error")
        }
    });
    return JSON.parse(JsonRet.responseText);
}

